  \"2016-02-26T18:44:13.659272\",\n\t\"name\": \"nist-internet-time-service\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Distributes NIST estimate of official U.S.
  time over the Internet in real time, using Network Time Protocol (NTP) and other
  time data formats to automatically synchronize clocks in computers and network devices
  to official U.S. time as realized by NIST several billions of times per day. This
  official U.S. time is the NIST estimate of Coordinated Universal Time (UTC), and
  called UTC(NIST). The accuracy of UTC(NIST) as distributed through the Internet
  Time Service (ITS) is on the order of 0.001 seconds (one millisecond), although
  accuracy can vary depending on network conditions and other parameters. rnrn Note
  that unlike most traditional datasets, time is intrinsically a transient, ever-changing
  quantity. As soon as UTC(NIST) is transmitted to a client, that particular value
  of UTC(NIST) no longer reflects the current time, which is constantly changing.
  There is thus no static storage of any time data, apart from internal diagnostic
  information not released to the public which ensures that UTC(NIST) as disseminated
  through the Internet Time Service (ITS) is commensurate with the official UTC(NIST)
  realization within the uncertainties of the system. rnrn  The vast majority of UTC(NIST)
  information distributed through ITS is provided freely, anonymously and automatically
  to the public. Any IP address can request UTC(NIST) through the ITS and the information
  is automatically and anonymously provided at no cost to the user. Full documentation
  of the ITS including all the source code is available to the public through the
  web site http://www.nist.gov/pml/div688/. rnrn NIST provides an authenticated version
  of ITS to a limited number of users (approximately 500 users near the end of calendar
  year 2015) who for various reasons want to ensure they are receiving UTC(NIST) without
  spoofing or interference with the information. This service uses public key encryption
  for the set of registered users to provide authenticated UTC(NIST). \",\n\t\"license_title\":
